import React from "react";
import '../stylesX/ContactUs.css';
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome';
import {faLocationDot, faPhone, faEnvelope} from '@fortawesome/free-solid-svg-icons';

function ContactUs() {
    return(
        <>
        <div id='bodyBox'>
            <h1 id='title'>Contact Us</h1>
            Do you have any questions for us? Please don't hesitate to contact us! Our team will respond within a matter of hours to assist you.
        </div>

        <div id='contactInfo'>
            <FontAwesomeIcon icon={faLocationDot}/> San Francisco, CA 94126, USA
            <br/><br/>
            <FontAwesomeIcon icon={faPhone}/> + 01 234 567 89
            <br/><br/>
            <FontAwesomeIcon icon={faEnvelope}/> contact@mdbootstrap.com
        </div>
        </>
    )
}

export default ContactUs;
